// Function to check the task status of the API request
function checkTaskStatus(taskId) {
  const xhr = new XMLHttpRequest();
  const url = `https://compute.triqsy.com/v1/tasks/${taskId}`;
  const method = "GET";

  xhr.open(method, url, true);
  xhr.setRequestHeader("Content-Type", "application/x-www-form-urlencoded");
  xhr.AllowAutoRedirect = false;
  xhr.onreadystatechange = function () {
    if (xhr.readyState === xhr.DONE) {
      console.log(xhr.response);
      const response = JSON.parse(xhr.response);
      if (response.status === "SUCCESS") {
        const imageString = response.image;

        imageArray.push("https://compute.triqsy.com/v1/results/"+response.result[0]);  
        imageStringOut.set("https://compute.triqsy.com/v1/results/"+response.result[0]);  

      } else if (response.status === "PENDING") {
        // Retry after a delay
        setTimeout(() => {
          checkTaskStatus(taskId);
        }, 1000);
      } else {
        // Handle other response statuses
      }
    }
  };

  xhr.send();

}


// Utility function to clamp a number between a minimum and maximum value
function clamp(num, min, max) {
  return num <= min 
    ? min 
    : num >= max 
      ? max 
      : num
}
